INSERT INTO `mdl_question` VALUES (1,6,0,'What is the Purpose of the GDPR?\nA. Remove Individual Control of Personal ...','What is the Purpose of the GDPR?\nA. Remove Individual Control of Personal Data\nB. Make the Regulatory environment more difficult for Business\nC. Give control back to EU citizens and Residents over their Personal Data\nD. Develop free trade relations with Japan\nANSWER : C\nThe GDPR replaces which current Directive?\nA. Data Protection Directive 95/46/EC\nB. Equality framework Directive 2000\nC. Equal Treatment in Goods and Services Directive 2004\nD. Equal Treatment Directive 2006\nANSWER : A\nGDPR applies to\nA. Promoters and Competitors.\nB. Delivery and Censorship.\nC. Customer Satisfaction and Brand Recognition.\nD. Controllers and Processor.\nANSWER : D\nA Controller\nA. Determines purpose and means of processing personal data.\nB. Determines end delivery.\nC. Creates graphs for data research.\nD. Handles all aspects of project management.\nANSWER : A',0,'',0,0.0000000,0.3333333,'description',0,'35.169.62.69:3000+180227085906+gNFXPx','35.169.62.69:3000+180227085906+JhxmEA',0,1519721946,1519721946,2,2),(2,6,0,'A Processor\nA. Is an internal machine that does calculations for personal ...','A Processor\nA. Is an internal machine that does calculations for personal computers.\nB. Processes personal data on behalf of the controller.\nC. Processes personal data for the data subject.\nD. Provides for transparent and accessible policies.\nANSWER : B',0,'',0,0.0000000,0.3333333,'description',0,'35.169.62.69:3000+180227085906+xZu1YM','35.169.62.69:3000+180227085906+Qfx2nP',0,1519721946,1519721946,2,2),(3,6,0,'If you are a Processor\nA. You are required to maintain personal records of ...','If you are a Processor\nA. You are required to maintain personal records of personal data and processing and have legal liability if you are responsible for a breach\nB. You are not required to maintain personal records or personal data.\nC. You have no legal liability if you are responsible for a breach.\nD. You are allowed to share information to the highest online bidder.\nANSWER : A',0,'',0,0.0000000,0.3333333,'description',0,'35.169.62.69:3000+180227085906+7JXi0G','35.169.62.69:3000+180227085906+5fHAfV',0,1519721946,1519721946,2,2),(4,6,0,'If you are a Controller\nA. GDPR places further obligations on you to ensure ...','If you are a Controller\nA. GDPR places further obligations on you to ensure your contracts with the processors comply with GDPR .\nB. GDRP place no obligations on you to ensure contracts with the processors comply with GDPR.\nC. GDPR provides trade relevant information on processors.\nD. GDPR provides delivery of products to processors in need.\nANSWER : A',0,'',0,0.0000000,0.3333333,'description',0,'35.169.62.69:3000+180227085906+tS200S','35.169.62.69:3000+180227085906+pqeE2L',0,1519721946,1519721946,2,2),(5,6,0,'International Non-EU Processors providing goods and services for individuals ...','International Non-EU Processors providing goods and services for individuals within the EU\nA. Are not subject to regulations listed in the GDPR.\nB. Are subject to the same regulations as Processors within the EU.\nC. Are subject to some regulations as Processors in the EU.\nD. Are subject to more regulations than Processors in the EU.\nANSWER : B',0,'',0,0.0000000,0.3333333,'description',0,'35.169.62.69:3000+180227085906+R1VITj','35.169.62.69:3000+180227085906+hn35Vz',0,1519721946,1519721946,2,2),(6,6,0,'What is the Purpose of the GDPR?','What is the Purpose of the GDPR?',0,'',0,1.0000000,0.3333333,'multichoice',1,'35.169.62.69:3000+180227090652+l5MFsq','35.169.62.69:3000+180227090652+Ot2Kdv',0,1519722412,1519722412,2,2),(7,6,0,'The GDPR replaces which current Directive?\nA. Data Protection Directive ...','The GDPR replaces which current Directive?\nA. Data Protection Directive 95/46/EC\nB. Equality framework Directive 2000\nC. Equal Treatment in Goods and Services Directive 2004\nD. Equal Treatment Direct