arch.; Handles all aspects of project management; Determines end delivery.; Determines purpose and means of processing personal data.','Determines purpose and means of processing personal data.',NULL,1519754470),(125,6,2,'deferredfeedback',22,1,1.0000000,0.0000000,1.0000000,0,'A Processor: Processes personal data on behalf of the controller.; Provides for transparent and accessible policies; Processes personal data for the data subject.; Is an internal machine that does calculations for personal computers.','Processes personal data on behalf of the controller.',NULL,1519754474),(126,6,3,'deferredfeedback',64,1,1.0000000,0.0000000,1.0000000,0,'Adhering to codes of conduct and certification schemes brings a number of benefits over and above demonstrating that you comply, they are: improve standards by establishing best practice.; improve transparency and accountability - enabling individuals to distinguish the organisations that meet the requirements of the law and they can trust with their personal data.; All of the above; provide mitigation against enforcement action.','All of the above',NULL,1519754478),(127,6,4,'deferredfeedback',66,1,1.0000000,0.0000000,1.0000000,0,'Article 23 of the GDPR empowers Member states to introduce exemptions from the GDPRs transparency obligations and individual rights only where: The restriction is a necessary and proportionate measure in a democratic society; All of the above; The restrictions respect the essence of the individuals fundamental rights; The restrictions respect the essence of the individual fundamental freedoms','All of the above',NULL,1519754463),(128,6,5,'deferredfeedback',29,1,1.0000000,0.0000000,1.0000000,0,'Article 5(2) requires that controllers: be responsible and be able to demonstrate compliance with the principles of GDPR.; be free from all legal responsibility.; 0%do not demonstrate compliance with the principles of GDPR; develop language skills.','be responsible and be able to demonstrate compliance with the principles of GDPR.',NULL,1519754463),(129,6,6,'deferredfeedback',52,1,1.0000000,0.0000000,1.0000000,0,'Automated Decision Making is making a decision: Using the internet; Using human resources; Solely on automated means without any human involvement; Using partial human involvement','Solely on automated means without any human involvement',NULL,1519754463),(130,6,7,'deferredfeedback',34,1,1.0000000,0.0000000,1.0000000,0,'Consent is a lawful basis of processing information it means:: Providing individuals information about someone else data; Offering individuals no choice and no control over their data; Offering individual real choice and control over their data; Selling individual data to the highest bidder','Offering individual real choice and control over their data',NULL,1519754463),(131,6,8,'deferredfeedback',36,1,1.0000000,0.0000000,1.0000000,0,'Contract is a lawful basis of processing information it means that: You can process data to comply with common law; You can process someones personal data to fulfill your contractual obligations to them.; You can process data to protect someones life.; You can process data to sell to the highest bidder.','You can process someones personal data to fulfill your contractual obligations to them.',NULL,1519754463),(132,6,9,'deferredfeedback',20,1,1.0000000,0.0000000,1.0000000,0,'GDPR applies to: Delivery and Censorship.; Controllers and Processor; Customer Satisfaction and Brand Recognition.; Promoters and Competitors.','Controllers and Processor',NULL,1519754463),(133,6,10,'deferredfeedback',26,1,1.0000000,0.0000000,1.0000000,0,'GDPR applies to personal data which is: Information relating to an identifiable person who can be directly or indirectly identified in particular by reference to an identifier.; Information from a published book; Information that is freely available on the internet.; Information relating to a person who cannot be identified with reference to an identifier.','Information relating to an identifiable person who can be directly or indirectly identified in particular by reference to an identifier.',NULL,1519754463),(134,6,11,'deferredfeedback',58,1,1.0000000,0.0000000,1.0000000,0,'GDPR contains explicit provisions about documenting your processing activities these include: Controllers and Processors both have documentation obligations.; All of the above; Records must be kept in writing.; Maintaining Records on processing purposes data sharing and retention.','All of the above',NULL,1519754463),(135,6,12,'deferredfeedback',24,1,1.0000000,0.0000000,1.0000000,0,'If you are a Controller: GDPR provides trade relevant information on processors.; GDPR provides delivery of products to processors in need; GDPR places further obligations on you to ensure your contracts with the processors comply with GDPR .; GDRP place no obligations on you to ensure contracts with the processors comply with GDPR.','GDPR places further obligations on you to ensure your contracts with the processors comply with GDPR .',NULL,1519754463),(136,6,13,'deferredfeedback',23,1,1.0000000,0.0000000,1.0000000,0,'If you are a Processor: You are not required to maintain personal records or personal data.; You are required to maintain personal records of personal data and processing and have legal liability if you are responsible for a breach; You are allowed to share information to the highest online bidder; You have no legal liability if you are responsible for a breach.','You are required to maintain personal records of personal data and processing and have legal liability if you are responsible for a breach',NULL,1519754463),(137,6,14,'deferredfeedback',25,1,1.0000000,0.0000000,1.0000000,0,'International Non-EU Processors providing goods and services for individuals within the EU: Are subject to the same regulations as Processors within the EU.; Are subject to some regulations as Processors in the EU.; Are not subject to regulations listed in the GDPR.; Are subject to more regulations than Processors in the EU','Are subject to the same regulations as Processors within the EU.',NULL,1519754463),(138,6,15,'deferredfeedback',59,1,1.0000000,0.0000000,1.0000000,0,'Privacy by Design is an approach to Projects promoted by the GDPR which means: That projects promote data protection and compliance at the end of the project; That projects promotes data protection and compliance from the start of the project and not as an afterthought.; That projects promote only compliance but no data protection from the start; That projects have no need to provide data protection and compliance at the end of the project','That projects promotes data protection and compliance from the start of the project and not as an afterthought.',NULL,1519754463),(139,6,16,'deferredfeedback',49,1,1.0000000,0.0000000,1.0000000,0,'Right to Object means individual can object to: Processing based on democratic interests; Processing based on personal interests; processing based on legitimate interests; processing based on illegitimate interests','processing based on legitimate interests',NULL,1519754463),(140,6,17,'deferredfeedback',27,1,1.0000000,0.0000000,1.0000000,0,'Sensitive Personal data: can identify an individual when processed.; cannot identify an individual.; is freely shared on the internet; is generic in nature.','can identify an individual when processed.',NULL,1519754463),(141,6,18,'deferredfeedback',63,1,1.0000000,0.0000000,1.0000000,0,'The DPOs minimum task is :: All of the above; To monitor compliance with the GDPR and other data protection laws, including managing internal data protection activities, advise on data protection impact assessments; train staff and conduct internal audits.; To inform and advise the organisation and its employees about their obligations to comply with the GDPR and other data protection laws.; To be the first point of contact for supervisory authorities and for individuals whose data is processed (employees, customers etc.).','All of the above',NULL,1519754463),(142,6,19,'deferredfeedback',65,1,1.0000000,0.0000000,1.0000000,0,'The GDPR introduces a duty on all organisation to report certain types of data breach to the relevant supervisory authority within: 24 hours; 72 hours; 48 hours; 96 Hours','72 hours',NULL,1519754463),(143,6,20,'deferredfeedback',19,1,1.0000000,0.0000000,1.0000000,0,'The GDPR replaces which current Directive?: Equal Treatment Directive 2006; Data Protection Directive 95/46/EC; Equal Treatment in Goods and Services Directive 2004; Equality framework Directive 2000','Data Protection Directive 95/46/EC',NULL,1519754463),(144,6,21,'deferredfeedback',46,1,1.0000000,0.0000000,1.0000000,0,'The principle underpinning the Right to erasure is: All information is accurate to the individual.; Removal of processing of information of an individual where there is no compelling reason for its continued processing.; Removal of processing of information of an individual where there is an accurate and compelling reason for its continued processing; All information is pertinent to the individual .','Removal of processing of information of an individual where there is no compelling reason for its continued processing.',NULL,1519754463),(145,6,22,'deferredfeedback',42,1,1.0000000,0.0000000,1.0000000,0,'The Right of Access means that individuals: Have the right to sell someone elses personal data; Have the right to access everybodys personal data.; Have the right to access their personal data.; Do not have the right to access their personal data.','Have the right to access their personal data.',NULL,1519754463),(146,6,23,'deferredfeedback',44,1,1.0000000,0.0000000,1.0000000,0,'The Right of Rectification gives individuals the right to have: Personal data rectified if is accurate and complete.; Personal data sold on the internet.; Personal data rectified if it is inaccurate or incomplete.; Personal data of other individuals rectified','Personal data rectified if it is inaccurate or incomplete.',NULL,1519754463),(147,6,24,'deferredfeedback',41,1,1.0000000,0.0000000,1.0000000,0,'The Right to be informed emphasises the need for: Hiding how you process personal data; Democracy.; Transparency over how you use personal data.; Individual freedom.','Transparency over how you use personal data.',NULL,1519754463),(148,6,25,'deferredfeedback',48,1,1.0000000,0.0000000,1.0000000,0,'The Right to Data Portability means that: Individuals have a right to reuse their own personal data for their own purposes across different services; Individuals have no right to use their data; Individuals have a right to sell other peoples data; Individuals have a right to reuse other peoples data for their own purposes across different sectors','Individuals have a right to reuse their own personal data for their own purposes across different services',NULL,1519754463),(149,6,26,'deferredfeedback',45,1,1.0000000,0.0000000,1.0000000,0,'The Right to erasure is also known as: The right to be known.; The right to be forgotten .; The right to be televised.; The right of rectification','The right to be forgotten .',NULL,1519754463),(150,6,27,'deferredfeedback',50,1,1.0000000,0.0000000,1.0000000,0,'The Right to Object to processing data can be made on the grounds that Processing Data: Overrides only trade interests of the individual; Overrides only freedoms of the individual; Overrides the interests, rights and freedoms of the individual; Overrides only rights of the individual','Overrides the interests, rights and freedoms of the individual',NULL,1519754463),(151,6,28,'deferredfeedback',51,1,1.0000000,0.0000000,1.0000000,0,'The Right to Object to processing data can be made on the grounds that Processing Data: Overrides only trade interests of the individual; Overrides only freedoms of the individual; Overrides only rights of the individual; Is for the establishment, exercise or defence of legal claims','Is for the establishment, exercise or defence of legal claims',NULL,1519754463),(152,6,29,'deferredfeedback',47,1,1.0000000,0.0000000,1.0000000,0,'The Right to Restrict Processing means that: The individual cannot suppress processing of personal data.; The individual has a right to block or suppress processing of personal data.; The individual has a right to sell personal data; The individual has a right to sell other peoples information','The individual has a right to block or suppress processing of personal data.',NULL,1519754463),(153,6,30,'deferredfeedback',62,1,1.0000000,0.0000000,1.0000000,0,'Under the GDPR a Data Protection Officer must be appointed if you: Are a public authority except for courts acting in their judicial capacity.; Carry out large scale processing of special categories of data or data relating to criminal convictions and offences.; All of the above; Carry out large scale systematic monitoring of individuals.','All of the above',NULL,1519754463),(154,6,31,'deferredfeedback',67,1,1.0000000,0.0000000,1.0000000,0,'Under what article does the GDPR contains provisions that are intended to enhance protection of children: Article 3; Article 23; Article 5; Article 8','Article 8',NULL,1519754463),(155,6,32,'deferredfeedback',35,1,1.0000000,0.0000000,1.0000000,0,'Vital Interest is a lawful basis for processing information it means that:: You cannot process data of the individual at all.; You can process data to comply with common law; You can process data to sell to the highest bidder.; You can process data to protect someones life.','You can process data to protect someones life.',NULL,1519754463),(156,6,33,'deferredfeedback',37,1,1.0000000,0.0000000,1.0000000,0,'What does GDPR provide you in terms of Rights: The Right of Access; Peace; Democracy; Project information','The Right of Access',NULL,1519754463),(157,6,34,'deferredfeedback',38,1,1.0000000,0.0000000,1.0000000,0,'What does GDPR provide you in terms of Rights: Democracy; Secularism; The Right of Data Portability; Peace','The Right of Data Portability',NULL,1519754463),(158,6,35,'deferredfeedback',39,1,1.0000000,0.0000000,1.0000000,0,'What does GDPR provide you in terms of Rights: Peace; The Right of Rectification; Secularism; Democracy','The Right of Rectification',NULL,1519754463),(159,6,36,'deferredfeedback',40,1,1.0000000,0.0000000,1.0000000,0,'What does GDPR provide you in terms of Rights: Secularism; Peace; Democracy; The Right to be Informed','The Right to be Informed',NULL,1519754463),(160,6,37,'deferredfeedback',60,1,1.0000000,0.0000000,1.0000000,0,'What does the Acronym DPIAs stand for: Data Protection Impact Arrangement; Data Protection Impact Assortment; Data Protection Impact Assessments; Data Protection Identified Amplitude','Data Protection Impact Assessments',NULL,1519754463),(161,6,38,'deferredfeedback',43,1,1.0000000,0.0000000,1.0000000,0,'What information is an individual entitled to under the Right of Access in the GDPR?: Political Information; Other individuals information.; Confirmation that their data is processed.; Trade information.','Confirmation that their data is processed.',NULL,1519754463),(162,6,39,'deferredfeedback',18,1,1.0000000,0.0000000,1.0000000,0,'What is the Purpose of the GDPR?: Make the Regulatory environment more difficult for Business; Give control back to EU citizens and Residents over their Personal Data; Develop free trade relations with Japan; Remove Individual Control of Personal Data','Give control back to EU citizens and Residents over their Personal Data',NULL,1519754463),(163,6,40,'deferredfeedback',53,1,1.0000000,0.0000000,1.0000000,0,'What methods can be applied to demonstrate Accountability and Governance provisions in the GDPR?: Implement appropriate technical and organisational measures that ensure and demonstrate compliance; Where appropriate appoint a data protection officer; Maintain relevant documentation on processing activities; All of the above','All of the above',NULL,1519754463),(164,6,41,'deferredfeedback',54,1,1.0000000,0.0000000,1.0000000,0,'What methods can be applied to demonstrate Accountability and Governance provisions in the GDPR?: All of the Above; Implement appropriate technical and organisational measures that ensure and demonstrate compliance; Use data protection impact assessments where appropriate; Where appropriate appoint a data protection officer','All of the Above',NULL,1519754463),(165,6,42,'deferredfeedback',55,1,1.0000000,0.0000000,1.0000000,0,'What methods can be applied to demonstrate Accountability and Governance provisions in the GDPR?: Where appropriate appoint a data protection officer.; All of the Above; Use data protection impact assessments where appropriate.; Adhere to approved codes of conduct and certification schemes.','All of the Above',NULL,1519754463),(166,6,43,'deferredfeedback',56,1,1.0000000,0.0000000,1.0000000,0,'When a controller uses a processor there is the need of: A Friendly unwritten agreement.; An email.; A Written Contract; An unsigned letter.','A Written Contract',NULL,1519754463),(167,6,44,'deferredfeedback',28,1,1.0000000,0.0000000,1.0000000,0,'Which Article in the GDPR sets out the main responsibilities for Organisations:: Article 2; Article 10; Article 14; Article 5','Article 5',NULL,1519754463),(168,6,45,'deferredfeedback',30,1,1.0000000,0.0000000,1.0000000,0,'Which of the following choices is a lawful basis of Processing Information:: Democracy; Governance; Consent; Litigation','Consent',NULL,1519754463),(169,6,46,'deferredfeedback',31,1,1.0000000,0.0000000,1.0000000,0,'Which of the following choices is a lawful basis of Processing Information:: Governance; Public Interest; Peace; Democracy','Public Interest',NULL,1519754463),(170,6,47,'deferredfeedback',32,1,1.0000000,0.0000000,1.0000000,0,'Which of the following choices is a lawful basis of Processing Information:: Development; Democracy; Legitimate Interest; Governance','Legitimate Interest',NULL,1519754463),(171,6,48,'deferredfeedback',33,1,1.0000000,0.0000000,1.0000000,0,'Which of the following choices is a lawful basis of Processing Information:: Contract; Democracy; Governance; Litigation','Contract',NULL,1519754463),(172,6,49,'deferredfeedback',57,1,1.0000000,0.0000000,1.0000000,0,'Why is a contract necessary between a controller and processor?: So that they establish a friendship.; So that they can know each others profit margins.; So that both parties understand only their responsibilities.; So that Both parties understand their responsibilities and liabilities','So that Both parties understand their responsibilities and liabilities',NULL,1519754463),(173,6,50,'deferredfeedback',61,1,1.0000000,0.0000000,1.0000000,0,'You need to conduct a DPIA when you use new technology, and the processing is likely to result in high risk to the rights and freedoms of individuals. Processing that results in high risk includes: All of the above; systematic and extensive processing activities including profiling and where decisions that have legal effects or similarly significant effects on individuals.; Large scale systematic monitoring of public areas (CCTV); large scale processing of special categories of data or personal data relation to criminal convictions or offences.','All of the above',NULL,1519754463);
